pragma solidity ^0.8.9;
pragma experimental ABIEncoderV2;

contract CryptoRSVP {
    struct User {
        string name;
        string avatarUrl;
        bool[] events;
    }

    struct Event {
        uint256 id;
        string name;
        uint256 seats;
        uint256 startTime;
        uint256 endTime;
        bool closed;
        bool cancelled;
        address[] participants;
    }

    address private owner;

    mapping(address => User) public users;
    mapping(uint256 => Event) public events;
    uint256 public nEvents;

    constructor() {
        owner = msg.sender;
        nEvents = 0;
    }

    function getOwner() public view returns (address) {
        return owner;
    }

    function updateUserProfile(string memory _name, string memory _avatarUrl)
        public
    {
        bool[] memory _events;
        users[msg.sender] = User(_name, _avatarUrl, _events);
    }

    function createEvent(
        string memory _name,
        uint256 _seats,
        uint256 _startTime,
        uint256 _endTime
    ) public returns (uint256) {
        uint256 _eventId = nEvents++;
        address[] memory _participants;

        events[_eventId] = Event(
            _eventId,
            _name,
            _seats,
            _startTime,
            _endTime,
            false,
            false,
            _participants
        );

        return _eventId;
    }

    function closeOutEvent(uint256 _eventId) public {
        // set event status to closed
        // distribute non-attendants' staked value to the attending participants
    }

    function cancelEvent(uint256 _eventId) public {
        events[_eventId].closed = true;
        events[_eventId].cancelled = true;

        // return staked values to participants
    }

    function checkInEventParticipant(uint256 _eventId, address _participant)
        public
    {
        // ...
    }

    function getEventParticipants(uint256 _eventId) public {
